import axios from "axios";


class API extends Component {
    state = {
        books: []
    };

    componentDidMount() {
        axios.get(`https://www.googleapis.com/books/v1/volumes?q=becoming`)
        .then( res => {
            console.log(res);
            this.setState({ books: res.data})
        })
    }

    render() {
        return(
            <div>
                <ul>
                    { this.state.books.map(books => <li>{books.title}</li>)}
                </ul>
            </div>
        )
    }
}

export default API;
